var optionOneOneOneTwoOneOneTwo = "You feel cramped in the space around you and with great reflexes launch yourself and Koby out of the hold Alvida made. <br><br> On the deck you see all of Alvidas crew staring at you. You prepare youself for battle as Koby gets behind you. Alvida jumps on the deck and glares at you. <br><br> 'Im going to enjoy this' she jeers <br><br> You laugh which only angers Alvida more. She proceeds to swing her club onto your head. It makes contact but you remain standing. You notice the shock in Alvidas eyes and proclaim <br><br> 'A blunt attack like that won't be enough to stop me, I ate the mythical devil fruit and am now made of rubber.' Stretching your arms back for momentum you launch Alvida off the ship. Her crew stare in awe and fear. You laugh and ask them if they have a small ship they can spare. You set sail with Koby looking for more adventure. <br><br> 'This Zoro fellow sounds interesting tell me more about him Koby'";

var optionOneOneOneTwoOneTwoOne = "You are in way over your head. You bow down and agree to join Alvidas pirate crew as their newest cabin boy alongside Koby. <br><br> YOU'RE A CABIN BOY!";

var optionOneOneOneTwoOneTwoTwo = "You've never bowed down to anyone before and you sure as hell ain't starting now. <br><br> 'No' you scream Alvida seems taken aback <br><br>  'No you say, no one says no to me' <br><br> With great fury and speed she hits your side with her club knocking you 60 ft through the side of the ship where you fall into the ocean and drown. <br><br> YOU'RE DEAD";

var optionOneOneTwoTwo = "You quickly make up your mind to play along. Maybe a chance to escape will present itself, besides there is no way you could beat these two men in a fight. <br><br> You find youself being roughly dragged upstairs where you find youself presented in front of a woman, who you can only assume is Captain Alvida. <br><br> 'Who is this' Alvida gleefully asks 'seems perfect company for Koby' <br><br> 'Just what Peppoko and I were thinking Captain' <br><br> 'Yeah' agrees Peppoko 'me and Poppoko found him in a barrel downstairs' <br><br> The next thing you know, a bucket and mop are in your hands and you are mopping Captain Alvida's ship as a cabin boy. <br><br> YOU'RE A CABIN BOY";

var optionOneOneTwoOneOne = "You run straight at them screaming loudly. The pirate on the right takes a step back and you seize the oppurtunity. Slashing wildly you manage to cut him on his sword hand. The sword crashes down and you go to turn towards the other pirate. But he's vanished from where he was. The last thing you hear is a whoosh from the opposite direction. <br><br> YOU'RE DEAD";

var optionOneOneTwoOneTwo = "You glasp your knife tightly and say in the most menacing tone you can <br><br> 'I was trained by Master Shang YunXiang in the art of Esgrima Criolla. I could disarm you in a matter of minutes' <br><br> To your dismay the two pirates only laugh and call your bluff, walking menacingly towards you. You repeat your warning with a quiver in your voice dropping your knife as both their swords come crashing down. <br><br> YOU'RE DEAD";

